import React,
      { Component } from 'react';
import { Link } from 'react-router-dom';

import Header                   from './../../components/Header';
import Footer                   from './../../components/Footer';
import CoverPage                from './../../components/CoverPage/TitleText';

class Carrers extends Component {
  render() {
    return (
      <div>

        <Header />

        <CoverPage
          title={(<span>Estamos procurando por <b>pessoas Criativas e Inteligentes</b><br /> para se juntar ao nosso time.</span>)} />

        <div className="container-page">

          <label data-label-carrer>Desenvolvedores</label>

          <div data-content-job>
            <p data-title>Desenvolvedor NodeJs Senior</p>
            <p data-location>Remoto</p>
          </div>

          <div data-content-job>
            <p data-title>Desenvolvedor PHP Pleno</p>
            <p data-location>Remoto</p>
          </div>

          <label data-label-carrer>Vendas</label>

          <div data-content-job>
            <p data-title>Vendedor Externo</p>
            <p data-location>Remoto</p>
          </div>

          <label data-label-carrer>Marketing</label>

          <div data-content-job>
            <p data-title>SEO</p>
            <p data-location>Remoto</p>
          </div>

        </div>

        <Footer/>

      </div>
    );
  }
}

export default Carrers;
